sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...

var arr =  inputs.object.products;

for(var i = 0 ; i< 18 ;i++)
{
 var id = 0;
 var gr = new GlideRecord('x_77533_nowcomme_0_products');
    gr.addQuery('product_id', arr[i].id.toString());
    gr.query();

    if (gr.next()) {

        continue;
       
    } else {
        // Create a new record
        gr.initialize();
        gr.product_id = arr[i].id.toString();
        gr.name = arr[i].title;
        gr.description = arr[i].body_html;
        gr.variant_id  = arr[i].variants[0].id.toString(); 
        gr.image = arr[i].image.src;    
        gr.price = arr[i].variants[0].price.toString();
        
        // add other fields as necessary
         id = gr.insert();


    }


}


})(inputs, outputs);

