sys_variable_value.value:
(function execute(inputs, outputs) {


var restMessage = new sn_ws.RESTMessageV2();
restMessage.setEndpoint("https://ac994e.myshopify.com/admin/api/2023-01/products.json");//add to Property
restMessage.setHttpMethod('GET');

// Set the header for Shopify Access Token
restMessage.setRequestHeader("X-Shopify-Access-Token", "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");//add to Property

// Execute the API call and handle the response
try {
    var response = restMessage.execute();
    var responseBody = response.getBody();
    var httpStatus = response.getStatusCode();
     
    // You can now use the responseBody as needed
    gs.info("Response: " + responseBody);
    outputs.results = JSON.parse(responseBody);
     // gs.info("Response: " + outputs.results);
} catch (ex) {
    var errorMsg = ex.getMessage();
    gs.error("Error in API Call: " + errorMsg);
}


// ... code ...
})(inputs, outputs);

